/**
 * @param {number[]} gas
 * @param {number[]} cost
 * @return {number}
 */
var canCompleteCircuit = function(gas, cost) {

    // reduce case
    let possibleStartArr = [];

    let accGas = 0;
    let accCost = 0;
    let toIndex = 0;
    let total = gas.length;
    for (let i = 0; i < total; i++){

        if (i != 0){
            accGas -= gas[i - 1];
            accCost -= cost[i - 1];
        }

        accGas += gas[toIndex % total];
        accCost += cost[toIndex % total];

        console.log("AccGas: " + accGas);
        console.log("AccCost: " + accCost);
        console.log("i: " + i);
        console.log("toIndex: " + toIndex);
        console.log("------------------------");


        if (accGas < accCost) {
            if (i === toIndex){
                toIndex++;
                accGas = gas[i];
                accCost = cost[i];
            }
            continue;
        }

        let flag = true;
        for (let j = toIndex + 1; j < total + i; j++){
            accGas += gas[j % total];
            accCost += cost[j % total];

            console.log("AccGas: " + accGas);
            console.log("AccCost: " + accCost);
            console.log("------------------------");

            if (accGas < accCost){

                console.log("j: " + j);
                console.log("------------------------");

                toIndex = j;
                flag = false;
                break;
            }
        }

        if (flag){
            return i;
            possibleStartArr.push(i);
        }
    }

    console.log("------------------------");
    console.log("Start");
    console.log("------------------------");
    console.log("Possible: " + possibleStartArr);

    for (let startIndex in possibleStartArr){
        let index = possibleStartArr[startIndex];
        console.log("Index: " + index);
        accGas = 0;
        accCost = 0;

        let flag = true;
        for (let i = index; i < total + index; i++){
            accGas += gas[i % total];
            accCost += cost[i % total];

            console.log("i: " + i);
            console.log("AccGas: " + accGas);
            console.log("AccCost: " + accCost);

            if (accGas < accCost){
                flag = false;
                continue;
            }
        }

        if (flag){
            return index;
        }
    }
    return -1;
};

